import { useParams } from "react-router-dom";
import { vehicles } from "../constants";
import Button from "./Button";

const Actioncenter = () => {
  const { model } = useParams();
  const car = vehicles.find((e) => e.model.toLowerCase() === model);

  return (
    <div className="actioncenter flex gapx-3 fixed w-full padding-x bottom-[1vh]">
      <button className="w-1/12 transition duration-200 lg:text-sm text-center font-semibold backdrop-blur-sm text-[12px] rounded md:w-auto inline-block w-full text-slate-200 bg-slate-700 bg-opacity-70 hover:bg-opacity-80">
        <i class="fal fa-comment-alt-dots" />
      </button>
      <Button
        label={`Custom Order ${car.model}`}
        to={car.orderLink}
        customClass="w-10/12"
      />
      <button className="w-1/12 transition duration-200 lg:text-sm text-center font-semibold backdrop-blur-sm text-[12px] rounded md:w-auto inline-block w-full text-slate-200 bg-slate-700 bg-opacity-70 hover:bg-opacity-80">
        <i className="fal fa-chevron-up" />
      </button>
    </div>
  );
};

export default Actioncenter;
